import Dot from "../../components/Sidebar/components/Dot";
import BigStat from "./components/BigStat/BigStat";
import {
  Delete as DeleteIcon,
  FilterList as FilterListIcon, MoreVert as MoreIcon,
} from "@material-ui/icons";
import PropTypes from "prop-types";
import { lighten } from "@material-ui/core/styles";
import cn from "classnames";

const MAP = {
  name: "my-map",
  areas: [
    { name: "1", shape: "poly", coords: [1433,473.5, 1312,468.625, 1305,417.667, 1427,419.625], fillColor: "yellow"  },
    { name: "2", shape: "poly", coords: [1412.242,540.188, 1317.25,532.495, 1325.874,482.188, 1420.25,487.682], fillColor: "yellow"  },
    { name: "3", shape: "poly", coords: [1481.311,557.5, 1422.25,542.181, 1441.313,488.5, 1500.25,498.589], fillColor: "yellow"  },
    { name: "4", shape: "poly", coords: [1306.376,533.17, 1231.891,533.417, 1224.376,484.417, 1304.97,484.499], fillColor: "yellow"  },

  ]
};


const styles = {
    paperContainer: {
        width: "100vh",
        height: "100vh",
        backgroundImage: `url(${Image})`
    }
};

var sectionStyle = {
    height: `calc(100vh + 58px)`,
    display: "flex",
    backgroundImage: `url(${Image})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    width: `calc(100vw + 58px)`,
    margin: -38,
    padding: 48
};

var sectionStyleArea = {
    height: `calc(100vh + 58px)`,
    display: "flex",
    backgroundPosition: 'center',
    width: `calc(100vw + 58px)`,
    margin: -38,
    padding: 48
};

const stylesMy = {
     width: `calc(100vw + 58px)`,
     margin: -38,
     padding: 48,
  };


function Cabinet() {
  var classes = useStyles();
  var theme = useTheme();



