<div style={{ width: '100%', border: '1px solid black', height: '100%', margin: '-10% -10% -10% -10%', overflow: 'hidden' }}>
<ImageMapper src={Image} map={MAP} style={{ maxWidth: '100%'}}
    />
    </div>  
  );

}

export default Cabinet;
